Several options for a possible mascot. Hermes is the symbol of speed :hogan: and the patron of trade, which is why it suits great - because ECO is about fast and reliable payments. And Aphrodite is the ancient Greek goddess of wisdom  (and ECO is smart finance:think: ) she also has an owl and I adore owls - they are nice. I couldn't choose just one. Perhaps there may be several mascots, who knows :reeee: 
